import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import FloatingMenu from './components/FloatingMenu.jsx';
import Home from './components/Home.jsx';
import ResumeVerification from './components/ResumeVerification.jsx';
import ResumeAnalytics from './components/ResumeAnalytics.jsx';
import GitHubAnalyzer from './components/GitHubAnalyzer.jsx';
import Login from './components/Login.jsx';
import Signup from './components/Signup.jsx';
import { AnalyticsProvider } from './context/AnalyticsContext';
import { AuthProvider } from './context/AuthContext';
import './App.css';
import AnimatedBackground from './components/AnimatedBackground';

const AppContent = () => {
  return (
    <AnalyticsProvider>
      <div className="App">
        <FloatingMenu />
        <div className="pt-8">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/verify" element={<ResumeVerification />} />
            <Route path="/analytics" element={<ResumeAnalytics />} />
            <Route path="/github-analyzer" element={<GitHubAnalyzer />} />
          </Routes>
        </div>
      </div>
    </AnalyticsProvider>
  );
};

function App() {
  // Animated background rendered once at app root

  return (
    <Router>
      <AuthProvider>
        <AppContent />
      </AuthProvider>
    </Router>
  );
}

export default App;
